        section #qr {
            height: 160px;
            width: 160px;
            margin-left: calc(795px - 60px - 160px);
            margin-top: calc(280px - 160px);
            /* background-image: url(); */
            background-color: white;
            position: absolute;
        }

        section .title {
            float: left;
            padding: 22px 65px 23px;
            margin-bottom: 42px;
            background-color: #ffffff;
            box-shadow: 0px 11px 9px 0px rgba(0, 0, 0, 0.5);
            color: #984AD1;
            font-family: "Lobster", cursive;
            font-size: 2.48em;
        }

        section .event {
            width: 50%;
            float: right;
            padding-top: 15px;
            font-family: "Open Sans", sans-serif;
            font-weight: 700;
            font-size: 2.24em;
            text-align: right;
            line-height: 55px;
            text-transform: uppercase;
        }

        section .event span:first-child {
            background-color: rgba(255, 255, 255, 0.5);
        }

        section .info {
            clear: both;
            font-weight: 900;
            margin-bottom: 40px;
            text-transform: uppercase;
        }

        section .info span:first-child {
            background-color: rgba(255, 255, 255, 0.9);
        }

        section .buyer {
            font-weight: 900;
            display: block;
        }

        section .buyer .data {
            display: block;
            margin-right: 150px;
            font-size: 8pt;
            padding-bottom: 25pt;
            text-transform: uppercase;
        }

        section .buyer .data:last-child {
            margin-right: 0;
        }

        section .buyer .data span:last-child {
            position: relative;
            font-family: "Kreon", serif;
            background-color: #fff;
            color: #984AD1;
            padding: 10px 15px;
            margin-left: 10px;
            font-size: 8pt;
            box-shadow: 0px 8px 8px 4px rgba(0, 0, 0, 0.5);
            vertical-align: middle;
        }

        .data span:first-child {
            font-size: 8pt;
            background-color: rgba(255, 255, 255, 0.9);
        }
    </style>

<body>
    <div class="container">
        <section>
            <!--<div id="qr"><img src=" " /></div>-->
            <div class="title">{{ exhibition }}</div>
            <div class="event"><span>{{ place }}</span></div>
            <div class="info"><span>{{ start }} // {{ end }} // Hermosillo // Sonora</span></div>
            <div class="buyer">
                <div class="data"> <span>Nombre del Comprador</span> <span>{{ buyer }}</span></div>
                <div class="data"> <span>ID</span> <span>{{ id }}</span></div>
            </div>
        </section>
    </div>
</body>
